import React from "react";
import {
  Button,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  FormHelperText,
  Container,
} from "@material-ui/core";
import {Field} from "formik";

const Step1 = (props) => {
  if (props.currentStep !== 1) return null;
  return (
    <Container>
      <Field
        component={Select}
        fullWidth
        name='duration'
        type='number'
        label='Duration:'>
        <MenuItem>1</MenuItem>
      </Field>
    </Container>
  );
};

export default Step1;
